import SecondaryLayout from "../../layout/SecondaryLayout";
import {
    FormWrapper, Placeholder,
    TypeVariantsCB,
} from "../../common/form_components";
import React from "react";
import SuggestFormControls from "./Controls/Controls";
import Grid from "@material-ui/core/Grid";


const SuggestForm = (props) => {
    const {
        values, touched, errors, suggestForm: {description},
        handleSubmit, handleReset, handleBack
    } = props;

    return (
        <SecondaryLayout>
            <FormWrapper caption="Письмо дизайнеру">
                <form noValidate onSubmit={handleSubmit}>
                    <Grid container>

                        {/*type variant*/}
                        <TypeVariantsCB
                            touched={touched} errors={errors}
                        />
                        {/*<TextInput*/}
                        <Placeholder name="description" label="Описание" multiline/>

                    </Grid>
                    <SuggestFormControls
                        onReset={handleReset}
                        onBack={handleBack}
                    />
                </form>
            </FormWrapper>
        </SecondaryLayout>
    );
}

export default SuggestForm
